   "source": [
    "#create and melt correlation matrix using cor() and melt functions \n",
    "num_data <- ps_data %>% \n",
    "  select(-c(\"gender\",\"customer_type\", \"type_of_travel\", \"class\", \"satisfaction\"))\n",
    "cormat <- round(cor(num_data, use = \"complete.obs\"), 2)\n",
    "head(cormat)\n",
    "\n",
    "melted_data <- melt(cormat)\n",
    "head(melted_data)"
   ]
  },
