   "source": [
    "# 0.4 - 0.59 is moderate and Positive correlation\n",
    "cormat_mc <- round(cor(num_data, use = \"complete.obs\") >= 0.4 & cor(num_data, use = \"complete.obs\") < 0.6, 2)\n",
    "melted_mc <- melt(cormat_mc)\n",
    "ggplot(data = melted_mc) + geom_tile(mapping = aes( x = Var2, y = Var1, fill = value)) +\n",
    "  labs(x = NULL, y = NULL, fill = NULL) +\n",
    "  scale_fill_gradient2(low = \"#0C6291\", mid = \"#FBFEF9\", high = \"#A63446\", limits=c(0,1)) +\n",
    "  theme_minimal() +\n",
    "  theme(axis.text.x = element_text(angle = 90, vjust = 1, hjust = 1)) +\n",
    "  coord_fixed() +\n",
    "  theme(\n",
    "    axis.title.x = element_blank(),\n",
    "    axis.title.y = element_blank(),\n",
    "    axis.text = element_text(color = \"black\", size = 12),\n",
    "    panel.grid.major = element_blank(),\n",
    "    panel.border = element_blank(),\n",
    "    panel.background = element_blank(),\n",
    "    axis.ticks = element_line(),\n",
    "    legend.direction = \"vertical\") +\n",
    "  guides(fill = guide_colorbar(barwidth = 1, barheight = 16.8,\n",
    "                               title.position = \"top\", title.hjust = 0.5))"
   ]
