   "source": [
    "# Distribution of Gender\n",
    "ggplot(data = aps_cleaned) + geom_bar(mapping = aes(gender), fill = \"navy blue\") +\n",
    "  labs(title = \"Distribution of Gender\", y = \"Number of Passegers\", x = \"Gender\") +\n",
    "  theme_bw() +\n",
    "  theme(axis.text = element_text(colour = \"black\")) +\n",
    "  geom_text(aes(gender, label = sprintf(\"%d (%s)\", ..count.., \n",
    "                                        pct_format(..count../sum(..count..)))), \n",
    "            stat = \"count\", vjust = -0.5) \n",
    "\n",
    "# Distribution of Customer Type\n",
    "ggplot(data = aps_cleaned) + geom_bar(mapping = aes(customer_type), fill = \"navy blue\") +\n",
    "  labs(title = \"Distribution of Customer Type\", y = \"Number of Passegers\", x = \"Customer Type\") +\n",
    "  theme_bw() +\n",
    "  theme(axis.text = element_text(colour = \"black\")) +\n",
    "  geom_text(aes(customer_type, label = sprintf(\"%d (%s)\", ..count.., \n",
    "                                        pct_format(..count../sum(..count..)))), \n",
    "            stat = \"count\", vjust = -0.5)\n",
    "\n",
    "# Distribution of Type of Travel\n",
    "ggplot(data = aps_cleaned) + geom_bar(mapping = aes(type_of_travel), fill = \"navy blue\") +\n",
    "  labs(title = \"Distribution of Type of Travel\", y = \"Number of Passegers\", x = \"Type of Travel\") +\n",
    "  theme_bw() +\n",
    "  theme(axis.text = element_text(colour = \"black\")) +\n",
    "  geom_text(aes(type_of_travel, label = sprintf(\"%d (%s)\", ..count.., \n",
    "                                               pct_format(..count../sum(..count..)))), \n",
    "            stat = \"count\", vjust = -0.5)\n",
    "\n",
    "# Distribution of Class\n",
    "ggplot(data = aps_cleaned) + geom_bar(mapping = aes(class), fill = \"navy blue\") +\n",
    "  labs(title = \"Distribution of Class\", y = \"Number of Passegers\", x = \"Class\") +\n",
    "  theme_bw() +\n",
    "  theme(axis.text = element_text(colour = \"black\")) +\n",
    "  geom_text(aes(class, label = sprintf(\"%d (%s)\", ..count.., \n",
    "                                                pct_format(..count../sum(..count..)))), \n",
    "            stat = \"count\", vjust = -0.5)\n",
    "\n",
    "# Distribution of Satisfaction Level\n",
    "ggplot(data = aps_cleaned) + geom_bar(mapping = aes(satisfaction), fill = \"navy blue\") +\n",
    "  labs(title = \"Distribution of Satisfaction Level\", y = \"Number of Passegers\", x = \"Satisfaction\") +\n",
    "  theme_bw() +\n",
    "  theme(axis.text = element_text(colour = \"black\")) +\n",
    "  geom_text(aes(satisfaction, label = sprintf(\"%d (%s)\", ..count.., \n",
    "                                       pct_format(..count../sum(..count..)))), \n",
    "            stat = \"count\", vjust = -0.5)"
   ]
