   "source": [
    "# Distribution of Passenger's Age based on Customer Type\n",
    "ggplot(data = aps_cleaned) + geom_bar(mapping = aes(age, fill = customer_type), width = 1) +\n",
    "  labs(title = \"Disribution of Passenger's Age based on Customer Type\", y = \"Number of Passeger\", X = \"Age\") +\n",
    "  scale_fill_manual(values = c(\"navy blue\", \"dark orange\")) +\n",
    "  theme_bw() +\n",
    "  facet_wrap(~customer_type)\n",
    "\n",
    "# Distribution of Passenger's Age by Customers Based on Satisfaction \n",
    "ggplot(data = aps_cleaned) + geom_bar(mapping = aes(age, fill = satisfaction), width = 1) +\n",
    "  labs(title = \"Distribution of Passenger's Age by Customers Based on Satisfaction\", \n",
    "       y = \"Number of Passegers\", x = \"Age\", fill = \"Satisfaction\") +\n",
    "  scale_fill_manual(values = c(\"navy blue\", \"dark orange\")) +\n",
    "  theme_bw() +\n",
    "  facet_wrap(~customer_type)"
   ]
