   "source": [
    "#Distribution of Gender based on Customer Type\n",
    "ggplot(data = aps_cleaned) + geom_bar(mapping = aes(gender, fill = customer_type, group = customer_type), position = \"dodge\") +\n",
    "  labs(title = \"Distribution of Gender based on Customer Type\", \n",
    "       y = \"Number of Passegers\", x = \"Gender\", fill = \"Customer Type\") +\n",
    "  scale_fill_manual(values = c(\"navy blue\", \"dark orange\")) +\n",
    "  theme_bw() +\n",
    "  geom_text(aes(gender, label = sprintf(\"%d (%s)\", ..count.., \n",
    "                                              pct_format(..count../sum(..count..))), group = customer_type), \n",
    "            stat = \"count\", vjust = -0.5, position = position_dodge(width = 0.9))\n",
    "  \n",
    "\n",
    "#Distribution of Travel Type based on Customer Type\n",
    "ggplot(data = aps_cleaned) + geom_bar(mapping = aes(type_of_travel, fill = customer_type), position = \"dodge\") +\n",
    "  labs(title = \"Distribution of Travel Type based on Customer Type\", \n",
    "       y = \"Number of Passegers\", x = \"Travel Type\", fill = \"Customer Type\") +\n",
    "  scale_fill_manual(values = c(\"navy blue\", \"dark orange\")) +\n",
    "  theme_bw() +\n",
    "  geom_text(aes(type_of_travel, label = sprintf(\"%d (%s)\", ..count.., \n",
    "                                        pct_format(..count../sum(..count..))), group = customer_type), \n",
    "            stat = \"count\", vjust = -0.5, position = position_dodge(width = 0.9))\n",
    "\n",
    "#Distribution of Class based on Customer Type\n",
    "ggplot(data = aps_cleaned) + geom_bar(mapping = aes(class, fill = customer_type), position = \"dodge\") +\n",
    "  labs(title = \"Distribution of Class based on Customer Type\", \n",
    "       y = \"Number of Passegers\", x = \"Travel Type\", fill = \"Customer Type\") +\n",
    "  scale_fill_manual(values = c(\"navy blue\", \"dark orange\")) +\n",
    "  theme_bw() +\n",
    "  geom_text(aes(class, label = sprintf(\"%d (%s)\", ..count.., \n",
    "                                                pct_format(..count../sum(..count..))), group = customer_type), \n",
    "            stat = \"count\", vjust = -0.5, position = position_dodge(width = 0.9))\n",
    "\n",
    "#Distribution of Satisfaction on Customer Type\n",
    "ggplot(data = aps_cleaned) + geom_bar(mapping = aes(satisfaction, fill = customer_type), position = \"dodge\") +\n",
    "  labs(title = \"Distribution of Satisfaction based on Customer Type\", \n",
    "       y = \"Number of Passegers\", x = \"Satisfaction\", fill = \"Customer Type\") +\n",
    "  scale_fill_manual(values = c(\"navy blue\", \"dark orange\")) +\n",
    "  theme_bw() +\n",
    "  geom_text(aes(satisfaction, label = sprintf(\"%d (%s)\", ..count.., \n",
    "                                       pct_format(..count../sum(..count..))), group = customer_type), \n",
    "            stat = \"count\", vjust = -0.5, position = position_dodge(width = 0.9))"
   ]
