   "source": [
    "datc_feedback <- aps_feedback %>% \n",
    "  select(customer_type, departure_and_arrival_time_convenience) %>% \n",
    "  filter(departure_and_arrival_time_convenience != 0) %>% \n",
    "  group_by(departure_and_arrival_time_convenience) %>% \n",
    "  summarise(num = n())\n",
    "ggplot(data = datc_feedback) + geom_bar(mapping = aes(departure_and_arrival_time_convenience, num), stat = \"identity\", fill = \"navy blue\") +\n",
    "  labs(title = \"Distribution of Departure and Arrival Time Convenience\", \n",
    "       y = \"Number of Passengers\", x = \"Departure and Arrival Time Convenience\") +\n",
    "  theme_bw() +\n",
    "  theme(axis.text = element_text(colour = \"black\")) +\n",
    "  geom_text(aes(departure_and_arrival_time_convenience, num, \n",
    "                label = sprintf(\"%d (%s)\", num, pct_format(num/sum(num)))),\n",
    "            vjust = -0.5)\n",
    "\n",
    "\n",
    "eob_feedback <- aps_feedback %>% \n",
    "  select(customer_type, ease_of_online_booking) %>% \n",
    "  filter(ease_of_online_booking != 0) %>% \n",
    "  group_by(ease_of_online_booking) %>% \n",
    "  summarise(num = n())\n",
    "ggplot(data = eob_feedback) + geom_bar(mapping = aes(ease_of_online_booking, num), stat = \"identity\", fill = \"navy blue\") +\n",
    "  labs(title = \"Distribution of Ease of Online Booking\", \n",
    "       y = \"Number of Passengers\", x = \"Ease of Online Booking\") +\n",
    "  theme_bw() +\n",
    "  theme(axis.text = element_text(colour = \"black\")) +\n",
    "  geom_text(aes(ease_of_online_booking, num, \n",
    "                label = sprintf(\"%d (%s)\", num, pct_format(num/sum(num)))),\n",
    "            vjust = -0.5)\n",
    "\n",
    "\n",
    "\n",
