   "source": [
    "datc_feedback <- aps_feedback %>% \n",
    "  select(customer_type, departure_and_arrival_time_convenience) %>% \n",
    "  filter(departure_and_arrival_time_convenience != 0) %>%\n",
    "  mutate(departure_and_arrival_time_convenience = replace(departure_and_arrival_time_convenience, departure_and_arrival_time_convenience >= 4, \"Promoters\")) %>% \n",
    "  mutate(departure_and_arrival_time_convenience = replace(departure_and_arrival_time_convenience, departure_and_arrival_time_convenience == 3, \"Passives\")) %>% \n",
    "  mutate(departure_and_arrival_time_convenience = replace(departure_and_arrival_time_convenience, departure_and_arrival_time_convenience <= 2, \"Detractors\")) %>%\n",
    "  group_by(departure_and_arrival_time_convenience) %>% \n",
    "  summarise(num = n())\n",
    "ggplot(data = datc_feedback) + geom_bar(mapping = aes(reorder(departure_and_arrival_time_convenience, -num), num), stat = \"identity\", fill = \"navy blue\") +\n",
    "  labs(title = \"Distribution of Departure and Arrival Time Convenience\", \n",
    "       y = \"Number of Passengers\", x = \"Departure and Arrival Time Convenience\") +\n",
    "  theme_bw() +\n",
    "  theme(axis.text = element_text(colour = \"black\")) +\n",
    "  geom_text(aes(departure_and_arrival_time_convenience, num, \n",
    "                label = sprintf(\"%d (%s)\", num, pct_format(num/sum(num)))),\n",
    "            vjust = -0.5)\n",
    "\n",
    "eob_feedback <- aps_feedback %>% \n",
    "  select(customer_type, ease_of_online_booking) %>% \n",
