   "source": [
    "datc_feedback <- aps_feedback %>% \n",
    "  select(customer_type, departure_and_arrival_time_convenience) %>% \n",
    "  filter(departure_and_arrival_time_convenience != 0) %>% \n",
    "  mutate(departure_and_arrival_time_convenience = replace(departure_and_arrival_time_convenience, departure_and_arrival_time_convenience >= 4, \"Promoters\")) %>% \n",
    "  mutate(departure_and_arrival_time_convenience = replace(departure_and_arrival_time_convenience, departure_and_arrival_time_convenience == 3, \"Passives\")) %>% \n",
    "  mutate(departure_and_arrival_time_convenience = replace(departure_and_arrival_time_convenience, departure_and_arrival_time_convenience <= 2, \"Detractors\")) %>% \n",
    "  group_by(customer_type, departure_and_arrival_time_convenience) %>% \n",
    "  summarise(num = n())\n",
    "ggplot(data = datc_feedback) + geom_bar(mapping = aes(reorder(departure_and_arrival_time_convenience, -num), num, fill = customer_type, group = customer_type), stat = \"identity\", position = \"dodge\") +\n",
    "  labs(title = \"Disribution of Departure and Arrival Time Convenience based on Customer Type\", y = \"Number of Passeger\", x = \"Departure and Arrival Time Convenience\" , fill = \"Customer Type\") +\n",
    "  scale_fill_manual(values = c(\"navy blue\", \"dark orange\")) +\n",
    "  theme_bw() +\n",
    "  geom_text(aes(departure_and_arrival_time_convenience, num, label = sprintf(\"%d (%s)\", num, \n",
    "                                                                             pct_format(num/sum(num))), group = customer_type), \n",
    "            vjust = -0.5, position = position_dodge(width = 0.9))\n",
    "\n",
    "eob_feedback <- aps_feedback %>% \n",
    "  select(customer_type, ease_of_online_booking) %>% \n",
    "  filter(ease_of_online_booking != 0) %>% \n",
    "  mutate(ease_of_online_booking = replace(ease_of_online_booking, ease_of_online_booking >= 4, \"Promoters\")) %>% \n",
    "  mutate(ease_of_online_booking = replace(ease_of_online_booking, ease_of_online_booking == 3, \"Passives\")) %>% \n",
    "  mutate(ease_of_online_booking = replace(ease_of_online_booking, ease_of_online_booking <= 2, \"Detractors\")) %>% \n",
    "  group_by(customer_type, ease_of_online_booking) %>% \n",
    "  summarise(num = n())\n",
    "ggplot(data = eob_feedback) + geom_bar(mapping = aes(reorder(ease_of_online_booking, -num), num, fill = customer_type, group = customer_type), stat = \"identity\", position = \"dodge\") +\n",
    "  labs(title = \"Disribution of Ease of Online Booking based on Customer Type\", y = \"Number of Passeger\", x = \"Ease of Online Booking\" , fill = \"Customer Type\") +\n",
    "  scale_fill_manual(values = c(\"navy blue\", \"dark orange\")) +\n",
    "  theme_bw() +\n",
    "  geom_text(aes(ease_of_online_booking, num, label = sprintf(\"%d (%s)\", num, \n",
    "                                                             pct_format(num/sum(num))), group = customer_type), \n",
    "            vjust = -0.5, position = position_dodge(width = 0.9))\n",
    "\n",
    "cis_feedback <- aps_feedback %>% \n",
